import React,{useState} from "react";
import '../App.css';
function Form(){
    const[Nom,setNom]=useState(null);
    const[Age,setAge]=useState(null);
    function handleChange(e){
        let leNom=document.getElementById("nom").value
        setNom(leNom)
        let leAge=document.getElementById("age").value
        setNom(leAge)
    }
    function hundelclick(e){
        e.preventDefault()
        console.log(Nom+" "+Age)
    }
        return(
            <div>
            Nom : <input type="text" id="nom" onchange={handleChange} />
            <br />
            Age : <input type="number" id="age" onchange={handleChange} />
            <br />
            <input type="submit" onChange={hundelclick} />
            </div>
        )
}
export default Form;
